    return (
        <div className="container py-5">
            <h1 className="py-2">Hooks Concept</h1>
            <h4> {id}--{name}</h4>
            <h4>{user}</h4>
            {
              user.map( (res,index)=> <li> {res}</li>
            )
            }
        </div>
    )
}
